import React, { Component } from 'react';
import Login from '../../login.component';
import { Switch, Route, Link } from 'react-router-dom';
import Axios from 'axios';
import DatePicker from "react-datepicker";
import Table from 'react-bootstrap/Table'
import DashBoard from '../../DashBoard';
import DeviceHome from '../../DeviceHome';

class Events extends Component{

    constructor(props){
        super(props);
        this.state = {
            startDate: new Date(),
            endDate : new Date(),
            sdate: "",
            edate: "",
            eventsList:[]
          };
        this._onButtonClick = this._onButtonClick.bind(this);
        this.handleDateChange = this.handleDateChange.bind(this);
        this.handleEndDateChange = this.handleEndDateChange.bind(this);
    }

    getParsedDate(date){
        date = String(date).split(' ');
        var year = String(date[3]).split('-');
        var month = new Date(Date.parse(String(date[1]).split(':') +" 1, 2012")).getMonth()+1;
        if(month< 10) month = "0"+month;
        var day = String(date[2]).split(':');
        return year+"-"+month+"-"+day+" ";
    }

    //#region events

    _onButtonClick(){
      Axios.post(process.env.REACT_APP_EVENTS_API+"getEvents",
      {
          headers: {
              'Access-Control-Allow-Origin': '*',
            },
      },
      {
        data:{
            _startDate: this.state.sdate,
            _endDate: this.state.edate
        }
      },
      {
          withCredentials : true
      }
      ).then(response=>{
          console.log(response.data);
          this.setState({
              eventsList : response.data
          })
      });
    }

    handleDateChange = date => {
        this.setState({
          startDate : date,
          sdate : this.getParsedDate(date)
        });
      };

      handleEndDateChange = date => {
        this.setState({
          endDate : date,
          edate : this.getParsedDate(date)
        });
      };

      //#endregion


    render(){
        return (
            <div>
                <div align="left">
                    <table>
                        <tbody>
                        <tr align="right">
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                            
                            <td align="right">
                            <Link to={'/navigation'}>Log Out</Link>
                            <Switch>
                                <Route exact path='/navigation' component={Login}/>
                            </Switch>
                            </td>
                        </tr>
                        </tbody>
                    </table>
                </div>

                <div>
                    <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <ul className="navbar-nav mr-auto">
                        <li><Link to={'/dashboard'} className="nav-link">DashBoard </Link></li>
                        <li><Link to={'/device_details'} className="nav-link">Device Details </Link></li>
                    </ul>
                    </nav>
                    <Switch>
                        <Route exact path ='/dashboard' component={DashBoard}/>
                        <Route exact path ='/device_details' component={DeviceHome}/>
                    </Switch>
                </div>

                <div>
                    <table> 
                        <tbody>
                            <tr>
                                <td><label>From Date:  </label></td>
                                <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                                <td><DatePicker selected={this.state.startDate} onChange={this.handleDateChange}/></td>
                            </tr>

                            <tr>
                                <td><label>To Date:  </label></td>
                                <td><span> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></td>
                                <td><DatePicker selected={this.state.endDate} onChange={this.handleEndDateChange}/></td>
                            </tr>
                            
                            <tr>
                                <td>
                                    <button type="submit" onClick={this._onButtonClick}>Submit</button>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>

                <div>
                    <div>
                        <div align="left">
                            <h3 align="left">Load Profile Data</h3>
                            <Table align="left" responsive="xl">
                                <thead align="left">
                                <tr>
                                    <th align="left">Date and Time</th>
                                    <th align="left">Category</th>
                                    <th align="left">Event Code</th>
                                    <th align="left">Event Description</th>
                                </tr>
                                </thead>
                                <tbody>
                                {
                                    this.state.eventsList.map(event =>
                                    <tr>
                                        <td align="left">{event._dateTime}</td>
                                        <td align="left">{event._category}</td>
                                        <td align="left">{event._id}</td>
                                        <td align="left">{event._description}</td>
                                    </tr>
                                    )
                                }
                                </tbody>
                            </Table>
                        </div>
                    </div>
                </div>

            </div>
        )
    }
}

export default Events;
